MODULE_AUTHOR("Registerfile Driver Generator (RFS Version), CAG, ZITI, Uni Heidelberg");
MODULE_DESCRIPTION("Driver to access the registerfile");
MODULE_VERSION("1.0");

module_init(extoll_rf_init);
module_exit(extoll_rf_exit);

